import Link from "next/link";
import { Navbar } from 'react-bootstrap';

const linkStyle = {
  marginRight: 15,
  color: 'white'
};

const Menu = () => (
  <div className="links">
    <Navbar bg="primary" variant="dark">
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    <Link href="/projects">
      <a style={linkStyle}>Projects</a>
    </Link>
    <Link href="/contact">
      <a style={linkStyle}>Contact</a>
    </Link>
    </Navbar>
    <style jsx>{`
      .links {
        padding: 10px;
        margin-bottom: 10px;
        height: 40px
      }
    `}</style>
  </div>
);

export default Menu;
